import React from 'react'
import Slider from "react-slick";
import { Autoplay } from 'swiper/modules';
// import "slick-carousel/slick/slick.css";
// import "slick-carousel/slick/slick-theme.css";


// const SlickSlider = () => {
//   return (
// <div>slick</div>
//   )
// }

export default function SlickSlider() {
    var settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        Autoplay:true,
    };
    return (
        <Slider {...settings}>
            <div>
                <h3>1</h3>
            </div>
            <div>
                <h3>2</h3>
            </div>
            <div>
                <h3>3</h3>
            </div>
            <div>
                <h3>4</h3>
            </div>
            <div>
                <h3>5</h3>
            </div>
            <div>
                <h3>6</h3>
            </div>
        </Slider>
    );
}
